-- 1) Existe al menos un registro CANCELADO AND EXISTS ( SELECT 1 FROM M10TABCLA C WHERE C.COD_COMUNA = A.COD_COMUNA AND C.COD_JUZGADO = A.COD_JUZGADO AND C.DESCRIPCION = A.DESCRIPCION AND C.ANODEMANDA = A.ANODEMANDA AND C.NROJUICIO = A.NROJUICIO AND C.FECHA_CANCEL > '01/01/1900' )
-- 2) Existe al menos un registro NO CANCELADO AND EXISTS ( SELECT 1 FROM M10TABCLA N WHERE N.COD_COMUNA = A.COD_COMUNA AND N.COD_JUZGADO = A.COD_JUZGADO AND N.DESCRIPCION = A.DESCRIPCION AND N.ANODEMANDA = A.ANODEMANDA AND N.NROJUICIO = A.NROJUICIO AND N.FECHA_CANCEL = '01/01/1900' );

