( SELECT MT.COD_COMUNA, MT.COD_JUZGADO, MT.DESCRIPCION, MT.ANODEMANDA, MT.NROJUICIO, CASE WHEN MT.FECHA_CANCEL > '01/01/1900' THEN 1 ELSE 0 END AS ESTADO FROM (
SELECT MC.COD_COMUNA, MC.COD_JUZGADO, MC.DESCRIPCION, MC.ANODEMANDA, MC.NROJUICIO, MC.FECHA_CANCEL FROM M10TABCLA MC WHERE MC.FECHA_BAJA = '01/01/1900' AND MC.FECHA_CANCEL BETWEEN '01/01/2017' AND '26/07/2017' AND MC.CODSISTEMA BETWEEN 0 AND 99) AS T, M10TABCLA MT WHERE T.COD_COMUNA = MT.COD_COMUNA AND T.COD_JUZGADO = MT.COD_JUZGADO AND T.DESCRIPCION = MT.DESCRIPCION AND T.ANODEMANDA = MT.ANODEMANDA AND T.NROJUICIO = MT.NROJUICIO) AS T2 GROUP BY T2.COD_COMUNA, T2.COD_JUZGADO, T2.DESCRIPCION, T2.ANODEMANDA, T2.NROJUICIO HAVING SUM(T2.ESTADO) > 0 AND SUM(T2.ESTADO) < COUNT(*);
SELECT MT.COD_COMUNA, MT.COD_JUZGADO, MT.DESCRIPCION, MT.ANODEMANDA, MT.NROJUICIO, CASE WHEN MT.FECHA_CANCEL > '01/01/1900' THEN 1 ELSE 0 END AS ESTADO FROM (SELECT MC.COD_COMUNA, MC.COD_JUZGADO, MC.DESCRIPCION, MC.ANODEMANDA, MC.NROJUICIO, MC.FECHA_CANCEL FROM M10TABCLA MC WHERE MC.FECHA_BAJA = '01/01/1900' AND MC.FECHA_CANCEL BETWEEN '01/01/2017' AND '26/07/2017' AND MC.CODSISTEMA BETWEEN 0 AND 99 ) AS T, M10TABCLA MT WHERE T.COD_COMUNA = MT.COD_COMUNA AND T.COD_JUZGADO = MT.COD_JUZGADO AND T.DESCRIPCION = MT.DESCRIPCION AND T.ANODEMANDA = MT.ANODEMANDA AND T.NROJUICIO = MT.NROJUICIO GROUP BY MT.COD_COMUNA, MT.COD_JUZGADO, MT.DESCRIPCION, MT.ANODEMANDA, MT.NROJUICIO HAVING SUM(CASE WHEN MT.FECHA_CANCEL > '01/01/1900' THEN 1 ELSE 0 END) > 0 AND SUM(CASE WHEN MT.FECHA_CANCEL > '01/01/1900' THEN 1 ELSE 0 END) < COUNT(*);
